import './home3.css';
import Homeservicebox from './Homeservicebox';
import { FaDesktop } from "react-icons/fa";

export default function Homethr() {
  return (
    <div>
       <div className="all">
            <div className="heading">
                <p className='intro3'>
                What i will do for you
                </p>
                <p className='services_text'>
                SERVICES
                </p>
            </div>
            <div className='services'> 
               <Homeservicebox IconName={<FaUser />} name="Web Design" text="I do ui/ux design for the website that helps website to get a unique look."/>
            </div>
       </div>
    </div>
  )
}
